import React, { useEffect, useState } from 'react';
import Carousel from './Carousel';

const Home = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetchImages();
  }, []);

  const fetchImages = () => {
    fetch('https://api.unsplash.com/photos/random?count=3&client_id=uPoFouDZNkccinMzkOwjg1w65Zzx5jaGSa6OL2Ja0ME')
      .then(response => response.json())
      .then(data => {
        const imageUrls = data.map(image => image.urls.regular);
        setImages(imageUrls);
      })
      .catch(error => {
        console.log('Error fetching images:', error);
      });
  };

  return (
    <div>
      <h1>Home</h1>
      <Carousel>
        {images.map((imageUrl, index) => (
          <div key={index}>
            <img src={imageUrl} alt={`Image ${index + 1}`} />
            <p className="legend">Legend {index + 1}</p>
          </div>
        ))}
      </Carousel>
    </div>
  );
};

export default Home;
